import React from 'react';
import './App.css'
import Sidebar from './components/Sidebar'
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import Project_Status from './pages/ProjectStatus';
import Home from './pages/Home';
import UpdateEmployee from './pages/UpdateEmployee';
import RemoveEmployee from './pages/RemoveEmployee';

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Sidebar>
          <Routes>
            <Route path='/Home' element={<Home />}></Route>
            <Route path='/ProjectStatus' element={<Project_Status />}></Route>
            <Route path='/UpdateEmployee' element={<UpdateEmployee />}></Route>
            <Route path='/RemoveEmployee' element={<RemoveEmployee />}></Route>
            <Route path='/Sidebar' element={<Sidebar/>}></Route>
          </Routes>
        </Sidebar>
      </BrowserRouter>
    </div>
  )
}

export default App;
